def _maybe_empty_lines(self, current_line: Line) -> Tuple[int, int]:
    max_allowed = 1
    if current_line.depth == 0:
        max_allowed = 2

    before = 0
    if current_line.leaves:
        first_leaf = current_line.leaves[0]
        if first_leaf.prefix:
            before = len(first_leaf.prefix.split("\n")) - 1
            if before > max_allowed:
                before = max_allowed
            first_leaf.prefix = ""

    depth = current_line.depth
    while self.previous_defs and self.previous_defs[-1] >= depth:
        self.previous_defs.pop()

        if depth == 0:
            before = 2
        else:
            before = 1

    if not current_line.is_decorator and not current_line.is_class and not current_line.is_def:
        if self.previous_line and not self.previous_line.is_decorator:
            newlines = 2
            if current_line.depth:
                newlines -= 1
        else:
            newlines = 0
        return (before, newlines)

    if current_line.is_flow_control:
        return (before, 1)

    if self.previous_line and self.previous_line.is_import and not current_line.is_import and depth == self.previous_line.depth:
        return (before or 1), 0

    if self.previous_line and self.previous_line.is_yield and (not current_line.is_yield or depth != self.previous_line.depth):
        return (before or 1), 0

    return before, 0
